      return<div className="d-flex flex-column col-1   align-items-center " >
      <div style = {{position: "fixed"}} >
      <h2> <i className="bi bi-house-fill text-success"></i></h2>


<h2><i className="bi bi-person-fill text-success mt-5">  </i></h2>


<h2><i className="bi bi-chat-text-fill text-success mv-5"> </i></h2>


